import request from '../../utils/fetch';

export const createCustomer = ({ form }) => 
    request.post(`/customers/createCustomer`, { companyName, contactPersonFirstname, contactPersonLastname, contactPersonMobile, contactPersonEmail, companyPhone, emirates, buildingNumber, street, address, file, fileName })


// fetch data
export const loadCustomer = ({ query }) => 
    request.post(`/customers/loadCustomers`, { query });

// delete data
export const deleteCustomer = ({ id }) =>
    request.post(`/customers/deleteCustomer`, { id })
